import classes from './Produce.module.css';
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Produce = (props) => {

    useEffect(() => {
        axios.get('/products')
        .then
    }, [])

    return (
        <div className={classes.Produce}>
            Hi Im the produce page
        </div>
    )
}

export default Produce;
